import React, {Fragment} from 'react'

function QuizContainer(props) {
    // console.log(props.questions[0].text)
    return(
        <>
            {props.questions.map(question, ind => <QuestionCard key={ind} question={question}/>)}

        </>
    )
}

export default QuizContainer
